import React from 'react';
import logo from './logo.png';

const About = () => {
    return (
        <header class="tc ph4">
          <h1 class="f3 f2-m f1-l fw2 mv3">Bruno Cunha</h1>
          <h2 class="f5 f4-m f3-l fw2 mt0 lh-copy">This is the subtitle where additional information can go if you really need it.</h2>
          <img src={logo} className='.br 3 w-30 pa4'/>
        </header>
    );
}

export default About;
